MaxCol = 106
MaxRow = 59
q = 12289
M = 512

def knuthYaoSingleNumber(r, q):
	# int row, col
	index = (r & 255)
	r >>= 8
	sample = LUT1[index]
	sampleMSB = (sample & 16)
	if (sampleMSB == 0):
		sampleMSB &= 15
		if ((r & 1) == 1):
			return q - sample
		else:
			return sample
	else:
		distance = (sample & 15) # maybe anded with 7 "but I have no idea why"
		index = (r & 31) + 32 * distance
		r >>= 5
		sample = LUT2[index]
		sampleMSB = (sample & 32)
		if (sampleMSB == 0):
			sample &= 31
			if ((r & 1) == 1):
				return q - sample
			else:
				return sample
		else:
			distance = (sample & 15) # No idea why
			col = 13
			while (col < MaxCol):
				distance = distance * 2 + (r & 1)
				r >>= 1
				row = MaxRow - 1
				while (row >= 0):
					# print(row)
					if (Pmat[row][col] > 0 or Pmat[row - 1][col] > 0 or Pmat[row - 2][col] > 0 or Pmat[row - 3][col] > 0 or Pmat[row - 4][col] > 0 or Pmat[row - 5][col] > 0 or Pmat[row - 6][col] > 0 or Pmat[row - 7][col] > 0):
						i = 0
						summ = 0
						while (i < 8):
							summ += Pmat[row - i][col]
							i += 1
						distance = distance - summ
						if (distance < 0):
							if (distance == -1):
								j = row - 7
								while (j >= row):
									if (Pmat[j][col] == 1):
										if ((r & 1) == 1):
											return q - j
										else:
											return j
									j += 1
							else:
								j = row - 7
								while (j >= row):
									distance += Pmat[j][col]
									if (distance == -1):
										if ((r & 1) == 1):
											return q - j
										else:
											return j
									j += 1
					row -= 8
				col += 1
	return 0

def plot():
	a = [0] * (12289)
	for idx in range(1, (1 << 16) - 1):
		a[knuthYaoSingleNumber(idx, q) % q] += 1
	print(a)

