def knuthYao(a, mod):
	n = len(a)
	i = 0
	while (i < n / 2):
		r = random.randint(0, 1 << 30)
		a[i << 1] = knuthYaoSingleNumber(r, mod)
		if ((i << 1) + 1 < n):
			random.randint(0, 1 << 30)
			a[(i << 1) + 1] = knuthYaoSingleNumber(r, mod)
		i+= 1
	return a

